describe("Dragging handles tests",function(){var a;describe("Dragging handles over each other",function(){it("should swap reliably given imprecision",function(){a=new Slider(document.getElementById("testSlider1"),{ticks:[0,1,2,3,4,5,6],value:[4,5],step:1,range:true});var c=["mousemove",true,true,document,0,0,0,undefined,a.sliderElem.offsetTop,false,false,false,false,0,null];var e=document.createEvent("MouseEvents");c[7]=a.ticks[4].offsetLeft+a.sliderElem.offsetLeft;e.initMouseEvent.apply(e,c);var b=document.createEvent("MouseEvents");c[7]=a.ticks[5].offsetLeft+a.sliderElem.offsetLeft;b.initMouseEvent.apply(b,c);var d=document.createEvent("MouseEvents");c[7]=a.ticks[6].offsetLeft+a.sliderElem.offsetLeft;d.initMouseEvent.apply(d,c);a.mousedown(e);expect(a._state.dragged).toBe(0);expect(a.getValue()).toEqual([4,5]);a.mousemove(b);expect(a._state.dragged).toBe(0);expect(a.getValue()).toEqual([5,5]);a.mousemove(d);expect(a._state.dragged).toBe(1);expect(a.getValue()).toEqual([5,6]);a.mousemove(b);expect(a._state.dragged).toBe(1);expect(a.getValue()).toEqual([5,5]);a.mousemove(e);expect(a._state.dragged).toBe(0);expect(a.getValue()).toEqual([4,5]);a.mouseup();expect(a._state.dragged).toBe(0);expect(a.getValue()).toEqual([4,5])})});afterEach(function(){if(a){if(a instanceof Slider){a.destroy()}a=null}})});